import React from 'react';
import './ExRoutes.css';

export default function ExRoutes() {
    return (
        <>
            <div className='ex-routes-container'>
                <div className='route'>
                    <table>
                        <thead>
                            <tr>
                                <th></th>
                            </tr>
                        </thead>
                    </table>
                </div>
                <div className='route'></div>
                <div className='route'></div>
                <div className='route'></div>
            </div>
        </>
    );
};
